function Header() {
    return(<>
        <div id="header">
        <Typography align="left" position={"absolute"}>
            <a href="/" >
              <img href="/" src={logo} style={{marginTop:"0%", height:"40px"}}></img>
            </a>
        </Typography>
        <Typography align='right' marginRight={"3vw"}>
        <Link style={{marginLeft: "auto"}} href="/login">
          <Button style={{"margin-right":"-4vw"}}>로그인</Button>
          </Link>
        </Typography>
        </div>
    </>)
}

export default Header;
